import React, { Component } from 'react';
import {withScriptjs,withGoogleMap,GoogleMap,Marker,MapWithMarker} from 'react-google-maps'


class Api extends Component {
  state = {  }
  render() { 
    <GoogleMap 
    defaultZoom={8}
    defaultCenter={{lat:-34.397,lng:150.644}}
    >
      <Marker position = {{lat:34.397,lng:150.644}} />
    </GoogleMap>
    return ( 
      <MapWithMarker 
      googleMapURL = "https://maps.googleapis.com/maps/api/js?key=AIzaSyBC8r72KNZPJs_zBcQiHe2BtDqx86k0F1M&v=3.exp&libraries=geometry"
      />
     );
  }
}
 
export default Api;
